import React from 'react';
import MovieItem from './MovieItem';

function MovieList({ movies }) {
  return (
    <div className="movie-list">
      {movies.map((movie, index) => (
        <MovieItem key={movie.id} movie={movie} index={index} />
      ))}
    </div>
  );
}

export default MovieList;
